CREATE TABLE `Almacena` (
  `posicion` int(11) NOT NULL AUTO_INCREMENT,
  `id_cofre` int(11) NOT NULL,
  `id_item` int(11) DEFAULT NULL,
  `cantidad` int(11) DEFAULT NULL,
  `durabilidad` int(11) DEFAULT NULL,
  `x` int(11) NOT NULL,
  `y` int(11) NOT NULL,
  `z` int(11) NOT NULL,
  PRIMARY KEY (`posicion`),
  KEY `id_cofre` (`id_cofre`),
  KEY `id_item` (`id_item`),
  CONSTRAINT `fk_almacena_cofre` FOREIGN KEY (`id_cofre`) REFERENCES `Cofre` (`id_cofre`) ON DELETE CASCADE,
  CONSTRAINT `fk_almacena_item` FOREIGN KEY (`id_item`) REFERENCES `Item` (`id_item`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=174 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci;

